function buildPasteMenuItem() {
    return {
        name: '',
        icon: 'rf rf-paste',
        click: function click(data, dispatch) {
            var sourceFileData = window.___cutFileData,
                copy = false;
            if (!sourceFileData) {
                sourceFileData = window.___copyFileData;
                copy = true;
            }
            if (!sourceFileData) {
                bootbox.alert("");
                return;
            }
            var newDir = data.fullPath;
            var newFullPath = newDir + "/" + sourceFileData.name,
                oldFullPath = sourceFileData.fullPath;
            if (oldFullPath === newFullPath) {
                bootbox.alert("");
                return;
            }
            var info = "" + sourceFileData.name + "" + newDir + "";
            if (copy) {
                info = "" + sourceFileData.name + "" + newDir + "";
            }
            bootbox.confirm(info, function (result) {
                if (!result) {
                    return;
                }
                window.___cutFileData = null;
                window.___copyFileData = null;
                if (!copy) {
                    moveFile(oldFullPath, newFullPath, dispatch);
                } else {
                    $.ajax({
                        url: window._server + '/frame/copyFile',
                        type: 'POST',
                        data: { newFullPath: newFullPath, oldFullPath: oldFullPath },
                        success: function success(data) {
                            var rootFile = data.repo.rootFile;
                            buildData(rootFile, 1);
                            dispatch({ data: rootFile, type: LOAD_END });
                        },
                        error: function error(response) {
                            if (response && response.responseText) {
                                bootbox.alert("<span style='color: red'>," + response.responseText + "</span>");
                            } else {
                                bootbox.alert("<span style='color: red'>,</span>");
                            }
                        }
                    });
                }
            });
        }
    };
}

