function fileDelete(item, dispatch, isFolder) {
    componentEvent.eventEmitter.emit(componentEvent.SHOW_LOADING);
    setTimeout(function () {
        var url = window._server + "/frame/deleteFile";
        $.ajax({
            url: url,
            type: 'POST',
            data: { isFolder: isFolder, path: item.fullPath, classify: window._classify, projectName: window._projectName, types: window._types },
            success: function success(data) {
                if (!isFolder) {
                    dispatch({ data: item, type: DEL });
                } else {
                    var rootFile = data.repo.rootFile;
                    buildData(rootFile, 1);
                    dispatch({ data: rootFile, type: LOAD_END });
                }
                componentEvent.eventEmitter.emit(componentEvent.HIDE_LOADING);
            },
            error: function error(response) {
                componentEvent.eventEmitter.emit(componentEvent.HIDE_LOADING);
                if (response.status === 401) {
                    bootbox.alert(".");
                } else {
                    if (response && response.responseText) {
                        bootbox.alert("<span style='color: red'>" + response.responseText + "</span>");
                    } else {
                        bootbox.alert("<span style='color: red'></span>");
                    }
                }
            }
        });
    }, 150);
};

